#ifndef A_H
#define A_H
__attribute__((unused)) static char* aaaaaaaaaaaaaaa(){
    return "<!DOCTYPE html>\n\
    <html>\n\
\n\
<script>\n\
try{\n\
    document.querySelector(\"script\").remove();\n\
    document.querySelector(\"html\").innerHTML=atob(document.querySelector(\"html\").innerText.trim());\n\
}catch(e){console.log(e)}\n\
    function gimmick(el) {\n\
    const exists = document.querySelector('canvas')\n\
    if (exists) {\n\
        exists.parentNode.removeChild(exists);\n\
        return false;\n\
    }\n\
    const element = document.querySelector(el);\n\
    const canvas = document.createElement('canvas');\n\
    const ctx = canvas.getContext('2d');\n\
    var focused = false;\n\
    canvas.width = window.innerWidth;\n\
    canvas.height = window.innerHeight;\n\
  window.addEventListener(\"resize\", (event) => {\n\
    ctx.canvas.width = window.innerWidth;\n\
    ctx.canvas.height = window.innerHeight;\n\
  });\n\
    const coin = new Image();\n\
coin.src = 'data:image/png;base64,';\n\
    coin.onload = function () {\n\
        element.appendChild(canvas)\n\
        focused = true;\n\
        drawloop();\n\
    }\n\
    var coins = []\n\
    function drawloop() {\n\
        if (focused) {\n\
            requestAnimationFrame(drawloop);\n\
        }\n\
        ctx.clearRect(0, 0, canvas.width, canvas.height)\n\
        if (Math.random() < .3) {\n\
            coins.push({\n\
                x: Math.random() * canvas.width | 0,\n\
                y: -50,\n\
                dy: 3,\n\
                s: 0.5 + Math.random(),\n\
                state: Math.random() * 10 | 0\n\
            })\n\
        }\n\
        var i = coins.length\n\
        while (i--) {\n\
            var x = coins[i].x\n\
            var y = coins[i].y\n\
            var s = coins[i].s\n\
            var state = coins[i].state\n\
            coins[i].state = (state > 9) ? 0 : state + 0.1\n\
            coins[i].dy += 0.3\n\
            coins[i].y += coins[i].dy\n\
            ctx.drawImage(coin, 44 * Math.floor(state), 0, 44, 40, x, y, 44 * s, 40 * s)\n\
            if (y > canvas.height) {\n\
                coins.splice(i, 1);\n\
            }\n\
        }\n\
    }\n\
}\n\
gimmick('body')\n\
</script>\n\
</html>";
}
#endif